import React from "react";
import "./allstore.css";

const Allstore = () => {
  return (
    <div>
      <div className="all">
        <div className="filterdiv"></div>
        <div className="shoediv">
          <div className="shoedivheader">
            <div></div>
            <div><p>icon</p><button>sort by</button></div>
          </div>
          <div className="shoedivbody"></div>
        </div>
        <div className="cartdiv"></div>
      </div>
    </div>
  );
};

export default Allstore;
